defs.value:
pub enum ContractError {
    Std(StdError),
    ZeroThreshold {
    },
    UnreachableThreshold {
    },
    InvalidGroup {
        addr: String,
    },
    Unauthorized {
    },
    NotOpen {
    },
    Expired {
    },
    NotExpired {
    },
    WrongExpiration {
    },
    AlreadyVoted {
    },
    WrongExecuteStatus {
    },
    WrongCloseStatus {
    },
}

pub enum Threshold {
    AbsoluteCount {
        weight: u64,
    },
    AbsolutePercentage {
        percentage: Decimal,
    },
    ThresholdQuorum {
        threshold: Decimal,
        quorum: Decimal,
    },
}

pub enum ExecuteMsg {
    Propose {
        title: String,
        description: String,
        msgs: Vec<CosmosMsg<Empty>>,
        latest: Option<Expiration>,
    },
    Vote {
        proposal_id: u64,
        vote: Vote,
    },
    Execute {
        proposal_id: u64,
    },
    Close {
        proposal_id: u64,
    },
    MemberChangedHook(MemberChangedHookMsg),
}

pub enum QueryMsg {
    Threshold {
    },
    Proposal {
        proposal_id: u64,
    },
    ListProposals {
        start_after: Option<u64>,
        limit: Option<u32>,
    },
    ReverseProposals {
        start_before: Option<u64>,
        limit: Option<u32>,
    },
    Vote {
        proposal_id: u64,
        voter: String,
    },
    ListVotes {
        proposal_id: u64,
        start_after: Option<String>,
        limit: Option<u32>,
    },
    Voter {
        address: String,
    },
    ListVoters {
        start_after: Option<String>,
        limit: Option<u32>,
    },
}
